Youth Attempted Suicide by Race/Ethnicit:
The percentage of students who reported attempting suicide one or more times in the past 12 months, by self-reported race/ethnicity.&nbsp;&nbsp;<br />
Race/ethnicity is defined as:<br />
Asian = Asian alone; Black = Black or African American alone; Latino = Hispanic/Latino of any race; White = White alone. Individuals who identified their race as American Indian/Alaskan Native, Native Hawaiian/Pacific Islander, or multiple Non-Hispanic/Latino races are not currently shown.&nbsp;
